import { useState } from 'react'
import { Link, useNavigate } from 'react-router-dom'
import { toast } from 'react-toastify'
import { registerUser as registerUserApi } from '../services/user'

function Paymentpage() {
    const [cardNumber, setCardNumber] = useState('');
    const [expiryDate, setExpiryDate] = useState('');
    const [cvv, setCVV] = useState('');
    const [name, setName] = useState('');
    const [paymentSuccess, setPaymentSuccess] = useState(false);

  // get the navigation object
  const navigate = useNavigate()

  const registerUser = async () => {
    if (firstName.length == '') {
      toast.error('Please enter first name')
    } else if (lastName.length == '') {
      toast.error('Please enter last name')
    } else if (email.length == '') {
      toast.error('Please enter email')
    } else if (mobile.length == '' ) {
      toast.error('Please enter mobile')
    } else if (password.length == '') {
      toast.error('Please enter password')
    } else if (confirmPassword.length == '') {
      toast.error('Please confirm password')
    } else if (password !== confirmPassword) {
      toast.error('Password does not match')
    } else {
      // call register api
      const response = await registerUserApi(
        firstName,
        lastName,
        email,
        password,
        gender,
        mobile
      )

      // parse the response
      if (response['status'] == 'success') {
        toast.success('Successfully registered a new user')

        // go back to login
        navigate('/')
      } else {
        toast.error('Error while registering a new user, please try again')
      }
    }
  }

  return (
    <div>
      <h1 style={{ textAlign: 'center', margin: 10 }}>Register User</h1>

      <div className='row'>
        <div className='col'></div>
        <div className='col'>
          <div className='form'>
            <div className='mb-3'>
              <label htmlFor=''>Card Number</label>
              <input
                type='text'
                className='form-control'
                onChange={(e) => {
                  setCardNumber(e.target.value)
                }}
              />
            </div>

            <div className='mb-3'>
              <label htmlFor=''>Name on Card</label>
              <input
                type='text'
                className='form-control'
                onChange={(e) => {
                  setName(e.target.value)
                }}
              />
            </div>

            <div className='mb-3'>
              <label htmlFor=''>CVV Number</label>
              <input
                type='text'
                className='form-control'
                onChange={(e) => {
                  setCVV(e.target.value)
                }}
              />
            </div>

            <div className='mb-3'>
              <label htmlFor=''>Expiry Date</label>
              <input
                type='text'
                className='form-control'
                onChange={(e) => {
                  setExpiryDate(e.target.value)
                }}
              />
        
            <div class="dropdown">
  <button class="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
    Month
  </button>
  <ul class="dropdown-menu">
    <li><a class="dropdown-item" href="#">January</a></li>
    <li><a class="dropdown-item" href="#">February</a></li>
    <li><a class="dropdown-item" href="#">March</a></li>
    <li><a class="dropdown-item" href="#">April</a></li>
    <li><a class="dropdown-item" href="#">May</a></li>
    <li><a class="dropdown-item" href="#">June</a></li>
    <li><a class="dropdown-item" href="#">July</a></li>
    <li><a class="dropdown-item" href="#">August</a></li>
    <li><a class="dropdown-item" href="#">September</a></li>
    <li><a class="dropdown-item" href="#">October</a></li>
    <li><a class="dropdown-item" href="#">November</a></li>
    <li><a class="dropdown-item" href="#">Decemeber</a></li>
  </ul>
</div>

<div class="dropdown">
  <button class="btn btn-secondary dropdown-toggle" type="button" data-bs-toggle="dropdown" aria-expanded="false">
    Year
  </button>
  <ul class="dropdown-menu">
    <li><a class="dropdown-item" href="#">2023</a></li>
    <li><a class="dropdown-item" href="#">2024</a></li>
    <li><a class="dropdown-item" href="#">2025</a></li>
    <li><a class="dropdown-item" href="#">2026</a></li>
    <li><a class="dropdown-item" href="#">2027</a></li>
    <li><a class="dropdown-item" href="#">2028</a></li>
    <li><a class="dropdown-item" href="#">2029</a></li>
    <li><a class="dropdown-item" href="#">2030</a></li>
  </ul>
</div>
</div>

            <div className='mb-3'>
              <div className='mb-3'>
                Add new Bank Account <Link to='/'>Add</Link>
              </div>
              <button onClick={registerUser} className='btn btn-success'>
                Pay Now
              </button>
            </div>
          </div>
        </div>
        <div className='col'></div>
      </div>
    </div>
  )
}

export default Paymentpage
